import React, { useEffect, useState } from "react";
import {
  ShowFilterType,
  SortByType,
  SortType,
  useStoreProfile,
} from "../../store-shipping";

import moment from "moment";
import { useNavigate, useParams } from "react-router-dom";
import { useStoreAddress } from "../../store-address";
import { useTransactionStore } from "../../store";
import useFetch from "../../hooks/useFetch";
import { IAddressResponse } from "../../interface";

const TableAddress = () => {
  const transactionState = useTransactionStore((state) => state);
  const navigate = useNavigate();
  const { setFetchAddress, addressDatas, filterAddress, dataFilter, loading } =
    useStoreAddress();
  const [input, setInput] = useState({
    show: "LAST_10_TRX",
    sortBy: "DATE",
    sort: "DESC",
    search: "",
  });
  console.log(dataFilter, "======================");
  console.log(addressDatas, "1111111111111111");

  const dateFormat = (date: string): string => {
    return moment(date).format("HH:mm - DD MMMM YYYY");
  };

  const handleChangeInput = (event: React.FormEvent<HTMLInputElement>) => {
    setInput({
      ...input,
      [event.currentTarget.name]: event.currentTarget.value,
    });
  };

  console.log(input, "e2e2e2e2");

  const handleFilter = () => {
    filterAddress(
      input.show as ShowFilterType,
      input.sortBy as SortByType,
      input.sort as SortType,
      input.search
    );
  };
  const handleChangeSelect = (event: React.FormEvent<HTMLSelectElement>) => {
    setInput({
      ...input,
      [event.currentTarget.name]: event.currentTarget.value,
    });
  };

  const handleClick = (addressID: number) => {
    transactionState.deleteAddress(addressID);
  };

  useEffect(() => {
    setFetchAddress();
  }, []);

  useEffect(() => {
    console.log(transactionState.message, "2e21ui2gi12eu1ieg12eugeuig2u");
    if (transactionState.message === "Deleted") {
      setFetchAddress();
    }
  }, [transactionState.message]);

  useEffect(() => {
    handleFilter();
  }, [input.show, input.sortBy, input.sort, input.search]);

  const renderTable = () => {
    return (
      <>
        <div className="d-flex flex-warp my-4">
          <div className="d-flex flex-fill align-items-center">
            <label className="m-0 me-2" />
            <p>Show</p>
            <select
              onChange={handleChangeSelect}
              defaultValue="THIS_MONTH"
              name="show"
              id="show"
              className="form-select"
            >
              <option value="LAST_10_TRX">Last 10 transactions</option>
              <option value="THIS_MONTH">This month</option>
              <option value="LAST_MONTH">Last month</option>
              <option value="THIS_YEAR">This year</option>
              <option value="LAST_YEAR">Last year</option>
            </select>
          </div>
          <div className="mx-1 my-2 d-flex align-items-center">
            <label htmlFor="sortBy" className="m-0 me-2">
              Sort By
            </label>
            <select
              name="sortBy"
              id="sortBy"
              className="form-select"
              onChange={handleChangeSelect}
            >
              <option value="DATE">Date</option>
              <option value="AMOUNT">Amount</option>
            </select>
          </div>
          <div className="mx-1 my-2">
            <select
              name="sort"
              id="sort"
              className="form-select"
              onChange={handleChangeSelect}
            >
              <option value="DESC">Descending</option>
              <option value="ASC">Ascending</option>
            </select>
          </div>
          <div className="mx-1 my-2">
            <input
              type="text"
              name="search"
              placeholder="Search..."
              onChange={handleChangeInput}
              className="form-control"
            />
          </div>
        </div>
        <div className="table-responsive">
          <table className="table table-striped table-bordered tabel-hover">
            <thead className="table-head">
              <tr>
                <th scope="col">Date & Time</th>
                <th scope="col">Full Address</th>
                <th scope="col">Recipient Name</th>
                <th scope="col">Recipient Phone Number</th>
                <th scope="col"></th>
                <th scope="col"></th>
                <th scope="col"></th>
              </tr>
            </thead>
            <tbody className="table-body">
              {dataFilter.map((addressState) => (
                <tr key={addressState.id}>
                  <td>{dateFormat(addressState.UpdatedAt)}</td>
                  <td>{addressState.full_address}</td>
                  <td>{addressState.recipient_name}</td>
                  <td>{String(addressState.recipient_phone_number)}</td>
                  <td>
                    <button
                      onClick={() => {
                        navigate(`/address/${addressState.id}`, {
                          replace: true,
                        });
                      }}
                      className="btn btn-success"
                    >
                      Detail
                    </button>
                  </td>
                  <td>
                    <button
                      className="btn btn-primary"
                      data-bs-toggle="modal"
                      data-bs-target="#exampleModal"
                    >
                      Edit
                    </button>
                    <div
                      className="modal fade"
                      id="exampleModal"
                      tabIndex={-1}
                      aria-labelledby="exampleModalLabel"
                      aria-hidden="true"
                    >
                      <div className="modal-dialog">
                        <div className="modal-content">
                          <div className="modal-header">
                            <h1
                              className="modal-title fs-5"
                              id="exampleModalLabel"
                            >
                              Edit Address
                            </h1>
                            <button
                              type="button"
                              className="btn-close"
                              data-bs-dismiss="modal"
                              aria-label="Close"
                            ></button>
                          </div>
                          {addressDatas.map((addresState) => (
                            <div key={addressState.id}>
                              <div className="modal-body">
                                <div className="md-auto">
                                  <form className="p-2">
                                    <div className="mb-3">
                                      <label>Address ID</label>
                                      <select
                                        // onChange={(e) => handleChange(e)}
                                        defaultValue={addresState.id}
                                        className="form-select"
                                        id="shipping_id"
                                        name="shipping_id"
                                        disabled
                                      >
                                        <option value={addresState.id}>
                                          {addressState.id}
                                        </option>
                                      </select>
                                      <label>Full Address</label>
                                      <input
                                        className="form-control"
                                        type="text"
                                        name="full_address"
                                        placeholder="Enter full address"
                                        id="inputFullAddress"
                                        onChange={(event) =>
                                          handleChangeInput(event)
                                        }
                                      />
                                    </div>
                                    <div className="mb-3">
                                      <label>Recipient Name</label>
                                      <input
                                        className="form-control"
                                        type="text"
                                        name="recipient_name"
                                        placeholder="Enter recipient name"
                                        id="inputRecipientName"
                                        onChange={(event) =>
                                          handleChangeInput(event)
                                        }
                                      />
                                    </div>
                                    <div className="mb-3">
                                      <label>Recipient Phone Number</label>
                                      <input
                                        className="form-control"
                                        type="number"
                                        name="recipient_phone"
                                        placeholder="Enter recipient phone number"
                                        id="inputRecipientPhoneNumber"
                                        onChange={(event) =>
                                          handleChangeInput(event)
                                        }
                                      />
                                    </div>
                                    <div className="p-2 d-grid gap-3">
                                      <button
                                        className="btn btn-success"
                                        type="submit"
                                        data-bs-toggle="modal"
                                        data-bs-target="#exampleModal"
                                        // onClick={(e) => handleSubmit(e)}
                                      >
                                        Create
                                      </button>
                                    </div>
                                  </form>
                                </div>
                              </div>
                              <div className="modal-footer">
                                <button
                                  type="button"
                                  className="btn btn-secondary"
                                  data-bs-dismiss="modal"
                                >
                                  Close
                                </button>
                                <button
                                  type="button"
                                  className="btn btn-primary"
                                >
                                  Save changes
                                </button>
                              </div>
                            </div>
                          ))}
                        </div>
                      </div>
                    </div>
                  </td>
                  <td>
                    <button
                      onClick={() => handleClick(addressState.id)}
                      className="btn btn-danger"
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </>
    );
  };

  return (
    <>
      <div className="container">{loading ? "loading" : renderTable()}</div>
    </>
  );
};

export default TableAddress;
